import React,{useEffect, useState} from 'react'

function App() {
  const [backendData, setBackendData] = useState([{}]);

  useEffect(()=>{
    fetch("/data").then(
      response=>response.json()
    ).then(
      data=>setBackendData(data)
    )
  },[])
  return (
    <div>
      {(typeof backendData.length==='undefined')?(
        <p>Loading...</p>
      ):(backendData.users.map((user,i) => {
        return (
          <div key={i}>
            <p>Name: {user.user_id}</p>
            <p>Name: {user.first_name}</p>
            <p>Name: {user.mid_name}</p>
            <p>Name: {user.last_name}</p>
            <p>Name: {user.dob}</p>
            <p>Age: {user.email}</p>
            <p>Age: {user.phone}</p>
          </div>
        )
      }))
      }
    </div>
  )
}

export default App
